iją.','Complianz provides your Cookie Policy with comprehensive cookie descriptions, supplied by cookiedatabase.org.'=>'Complianz pateikia jūsų slapukų politiką su išsamiais slapukų aprašymais, kuriuos pateikia cookiedatabase.org.','Complianz provides your Cookie Policy with comprehensive cookie descriptions, supplied by cookiedatabase.org. We connect to this open-source database using an external API, which sends the results of the cookiescan (a list of found cookies, used plugins and your domain) to cookiedatabase.org, for the sole purpose of providing you with accurate descriptions and keeping them up-to-date on a regular basis.'=>'Complianz pateikia jūsų slapukų politiką su išsamiais slapukų aprašymais, kuriuos pateikia cookiedatabase.org. Prie šios atvirojo kodo duomenų bazės jungiamės naudodami išorinę API, kuri siunčia slapukų nuskaitymo rezultatus (rastų slapukų sąrašą, naudotus papildinius ir jūsų domeną) į cookiedatabase.org, siekdama vienintelio tikslo pateikti jums tikslius aprašymus ir saugoti. juos reguliariai atnaujina.','Complianz will scan several pages of your website for first-party cookies and known third-party scripts. The scan will be recurring monthly to keep you up-to-date!'=>'Complianz nuskaitys kelis jūsų svetainės puslapius, ar nėra pirmosios šalies slapukų ir žinomų trečiųjų šalių scenarijų. Nuskaitymas bus kartojamas kas mėnesį, kad gautumėte naujausią informaciją!','Complianz | GDPR/CCPA Cookie Consent'=>'Complianz | BDAR/CCPA sutikimas naudoti slapukus','Configuration'=>'Konfigūracija','Configuration by Complianz'=>'„Complianz“ konfigūracija','Configure your Cookie Notice, Cookie Consent and Cookie Policy with our Wizard and Site Scan. Supports GDPR, DSGVO, TTDSG, LGPD, POPIA, RGPD, CCPA and PIPEDA.'=>'Sukonfigūruokite savo slapukų pranešimą, sutikimą dėl slapukų ir slapukų politiką naudodami vedlį ir svetainės nuskaitymą. Palaiko BDAR, DSGVO, TTDSG, LGPD, POPIA, RGPD, CCPA ir PIPEDA.','Configuring Consent Mode & Tag Manager'=>'Sutikim