ose icon will be shown on your consent banner.'=>'Jei įjungta, sutikimo reklamjuostėje bus rodoma uždarymo piktograma.','If enabled, the cookie warning will not show for countries without a cookie law, and will adjust consent management depending on supported privacy laws'=>'Jei įjungta, slapukų įspėjimas nebus rodomas šalyse, kuriose nėra slapukų įstatymo, o sutikimo tvarkymas bus pritaikytas atsižvelgiant į palaikomus privatumo įstatymus.','If enabled, the plugin will track which consent banner has the best conversion rate.'=>'Jei įgalintas, papildinys stebės, kurios sutikimo reklamjuostės konversijų rodiklis yra geriausias.','If enabled, the plugin will visualize stored records of consent.'=>'Jei įjungta, įskiepis pavaizduos saugomus sutikimo įrašus.','If so, the scan will be extended to the wp-admin part of your site. '=>'Jei taip, nuskaitymas bus išplėstas iki jūsų svetainės wp-admin dalies.','If the Cookie Blocker causes an issue, you can enable Safe Mode under settings. Disabling Safe Mode will activate the Cookie Blocker.'=>'Jei slapukų blokavimo priemonė sukelia problemą, nustatymuose galite įjungti saugųjį režimą. Išjungus saugųjį režimą bus suaktyvinta slapukų blokavimo priemonė.','If this user stops editing, the lock will expire after %s minutes.'=>'Jei šis vartotojas nustos redaguoti, užraktas nustos galioti po %s minučių.','If you add the ID for your Statistics tool here, Complianz will configure your site for statistics tracking.'=>'Jei čia pridėsite savo statistikos įrankio ID, Complianz sukonfigūruos jūsų svetainę statistikos stebėjimui.','If you add the ID for your statistics tool here, Complianz will configure your site for statistics tracking.'=>'Jei čia pridėsite savo statistikos įrankio ID, Complianz sukonfigūruos jūsų svetainę statistikos stebėjimui.','If you choose \'No\', Complianz will block all known Google Fonts sources.'=>'Jei pasirinksite „Ne“, „Complianz“ užblokuos visus žinomus „Google Fonts“ šaltinius.','If you choose Complianz to handle your statistics implementation, please delete the current implementation.'=>'Jei statistikos diegimui tvarkyti pasirinksite „Complianz“, ištrinkite dabartinį diegimą.','If you choose to block reCAPTCHA, please make sure you add a placeholder to your forms.'=>'Jei nuspręsite blokuoti reCAPTCHA, būtinai prie formų pridėkite rezervuotąją vietą.','If you choose to create your Legal Hub with Elementor Pro we will import our default template.'=>'Jei nuspręsite sukurti teisinį centrą naudodami „Elementor Pro“, importuosime numatytąjį šabloną.','If you enable this option, Complianz will not show the consent banner to users that enabled a ‘Do Not Track’ or \'Global Privacy Control\' setting in their browsers and their default consent status is set to ‘denied’.'=>'Jei įgalinsite šią parinktį, „Complianz“ nerodys sutikimo reklamjuostės naudotojams, kurie savo naršyklėse įgalino nustatymą „Nestebėti“ arba „Visuotinė privatumo kontrolė“, o numatytoji sutikimo būsena nustatyta į „atmesta“.','If you enable this setting, a consent banner will be enabled, if needed.'=>'Jei įgalinsite šį nustatymą, prireikus bus įgalinta sutikimo reklamjuostė.','If you enable this, WordPress will not store personal data with comments and you won\'t need a consent checkbox for the comment form. The consent box will not be displayed.'=>'Jei tai įjungsite, „WordPress“ nesaugos asmeninių duomenų su komentarais ir jums nereikės komentaro formos sutikimo žymės langelio. Sutikimo laukelis nebus rodomas.','If you encounter issues, you can also go to the <a href="%s">support</a> form directly.'=>'Jei kyla problemų, taip pat galite tiesiogiai eiti į <a href="%s">palaikymo</a> formą.','If you experience styling issues with videos or iFrames you can disable the placeholder insertion, which in some themes can conflict with theme styling.'=>'Jei susiduriate su vaizdo įrašų ar „iFrame“ rėmelių stiliaus problemomis, galite išjungti rezervuotos vietos įterpimą, kuris kai kuriose temose gali prieštarauti temos stiliui.','If you select custom, you need to add your custom image to your site.'=>'Jei pasirinksite tinkintą, turėsite pridėti tinkintą vaizdą prie savo svetainės.','If you select the option that IP addresses are anonymized, and let Complianz handle the statistics, Complianz will ensure that ip addresses are anonymized by default, unless consent is given for statistics.'=>'Jei pasirinksite parinktį, kad IP adresai būtų anonimizuoti, ir leisite Complianz tvarkyti statistiką, Complianz užtikrins, kad IP adresai būtų anonimizuoti pagal numatytuosius nustatymus, nebent bus duotas sutikimas dėl statistikos.','If you show advertising on your website, or place scripts for advertising purposes e.g. Google Shopping or remarketing, please answer with Yes.'=>'Jei savo svetainėje rodote reklamą, arba talpinate scenarijus reklamos tikslais, pvz. „Google“ apsipirkimas ar pakartotinė rinkodara, atsakykite „Taip“.','If you want to clear all cookies from the plugin, you can do so here. If you want to start with a clean slate, you might need to clear your browsercache, to make sure all cookies are removed from your browser as well.'=>'Jei norite išvalyti visus slapukus iš papildinio, tai galite padaryti čia. Jei norite pradėti nuo švaraus lapo, gali tekti išvalyti naršyklės talpyklą, kad įsitikintumėte, jog visi slapukai taip pat yra pašalinti iš naršyklės.','If you want to dynamically apply privacy laws based on the visitor\'s location, consider upgrading to the premium version, which allows you to apply a privacy law specific for that region.'=>'Jei norite dinamiškai taikyti privatumo įstatymus pagal lankytojo vietą, apsvarstykite galimybę naujovinti į premium versiją, kuri leidžia taikyti tam regionui būdingą privatumo įstatymą.','If you want to start from the default values, you can use the reset button.'=>'Jei norite pradėti nuo numatytųjų verčių, galite naudoti nustatymo iš naujo mygtuką.','If you\'re using AdSense, AdManager or AdMob, please choose Google CMP Certified Consent Management, for other advertising products that don\'t use Google you can only use TCF.'=>'Jei naudojate „AdSense“, „AdManager“ arba „AdMob“, pasirinkite „Google“ CMP sertifikuotą sutikimo valdymą. Kituose reklamavimo produktuose, kuriuose nenaudojama „Google“, galite naudoti tik SSP.','Import'=>'Importuoti','Impressum'=>'Nuosavybės ir autorystės pareiškimas','Imprint'=>'Bendra kontaktinė informacija','Improve Security'=>'Pagerinti saugumą','In September 2023 the Quebec bill 64 will be enforced in Canada. In order to keep your site compliant, %sopt-in must be implemented for Canada%s. Please Navigate to the %sWizard%s and enable opt-in for Canada.'=>'2023 m. rugsėjį Kanadoje bus pradėtas vykdyti Kvebeko įstatymo projektas 64. Kad jūsų svetainė atitiktų reikalavimus, Kanada%s turi būti įdiegtas %spasirinkimas. Eikite į %svedlį%s ir įgalinkite Kanados pasirinkimą.','In one ore more regions your selected, you need to specify if you target children.'=>'Viename ar keliuose jūsų pasirinktuose regionuose turite nurodyti, ar taikote vaikams.','In some countries, like Germany, Austria, Belgium or Spain, consent is required for statistics, even if the data is anonymized.'=>'Kai kuriose šalyse, pavyzdžiui, Vokietijoje, Austrijoje, Belgijoje ar Ispanijoje, reikalingas sutikimas statistikai, net jei duomenys yra anonimiški.','Inactive'=>'Neaktyvus','India'=>'Indija','Indicate for what purpose personal data is processed via your website:'=>'Nurodykite, kokiu tikslu jūsų svetainėje tvarkomi asmens duomenys:','Indonesia'=>'Indonezija','Install'=>'Diegti','Install %sManually%s.'=>'Įdiekite %sRankiniu būdu%s.','Installation finished'=>'Diegimas baigtas','Installed'=>'Įdiegta','Installing'=>'Diegimas','Installing plugin...'=>'Diegiamas papildinys...','Insurance policy number'=>'Draudimo poliso numeris','Integrate Forminator with Complianz Privacy Suite'=>'Integruokite Forminator su Complianz Privacy Suite','Integrating Hotjar'=>'"Hotjar" integravimas','Integrating Hubspot'=>'"Hubspot" integravimas','Integrations'=>'Integracijos','Internet activity information, including, but not limited to, browsing history, search history, and information regarding a consumer\'s interaction with an Internet Web site, application, or advertisement'=>'Informacija apie veiklą internete, įskaitant, bet neapsiribojant, naršymo istoriją, paieškos istoriją ir informaciją apie vartotojo sąveiką su interneto svetaine, programa ar reklama','Invalid license.'=>'Neteisinga licencija.','Iran, Islamic Republic Of'=>'Iranas, Islamo Respublika','Iraq'=>'Irakas','Ireland'=>'Airija','Is Hotjar configured in a privacy-friendly way?'=>'Ar „Hotjar“ sukonfigūruotas privatumui palankiu būdu?','Isle Of Man'=>'Meno sala','Israel'=>'Izraelis','It is highly recommended that you back up your data before updating to the Beta version. Beta versions are not intended for production environments or critical systems. They are best suited for users who are willing to explore new features and provide feedback.'=>'Prieš atnaujinant į beta versiją, labai rekomenduojama pasidaryti atsarginę duomenų kopiją. Beta versijos nėra skirtos gamybos aplinkoms ar kritinėms sistemoms. Jie geriausiai tinka naudotojams, kurie nori ištirti naujas funkcijas ir pateikti atsiliepimų.','It is necessary for credit protection'=>'Tai būtina kredito apsaugai','It is necessary for my own legitimate interest, and that interest outweighs the interest of the person concerned'=>'Tai būtina dėl mano paties teisėto intereso ir tas interesas nusveria atitinkamo asmens interesus','It is necessary for the execution of an agreement with the person concerned'=>'Tai būtina susitarimo su suinteresuotu asmeniu vykdymui','It is necessary for the protection of health, exclusively, in a procedure performed by health professionals, health services or health authority'=>'Tai būtina sveikatos apsaugai, išimtinai sveikatos priežiūros specialistų, sveikatos tarnybų ar sveikatos priežiūros institucijos atliekamoje procedūroje','It is necessary for the regular exercise of rights in judicial, administrative or arbitration proceedings'=>'Tai būtina norint reguliariai naudotis teisėmis teisminiuose, administraciniuose ar arbitražo procesuose','It is necessary to carry out studies by a research body, ensuring, whenever possible, the anonymization of personal data'=>'Būtina atlikti tyrimų įstaigos tyrimus, užtikrinant, kai įmanoma, asmens duomenų anonimiškumą','It is necessary to protect the life or physical safety of a person'=>'Būtina apsaugoti žmogaus gyvybę ar fizinį saugumą','It is recommended to select a Privacy Statement.'=>'Rekomenduojama pasirinkti Privatumo pareiškimą.','It will be replaced with the name of the category that is blocked.'=>'Jis bus pakeistas užblokuotos kategorijos pavadinimu.','It will be replaced with the name of the service that is blocked.'=>'Jis bus pakeistas užblokuotos paslaugos pavadinimu.','It\'s possible to use region redirect when GEO IP is enabled, and you have multiple policies and statements.'=>'Galima naudoti regiono peradresavimą, kai įjungtas GEO IP ir turite kelias strategijas bei pareiškimus.','It\'s recommended to let Complianz handle the statistics script. This way, the plugin can detect if it needs to be hooked into the cookie consent code or not. But if you have set it up yourself and don\'t want to change this, you can choose to do so.'=>'Rekomenduojama leisti Complianz tvarkyti statistikos scenarijų. Tokiu būdu papildinys gali nustatyti, ar jį reikia prijungti prie slapuko sutikimo kodo, ar ne. Bet jei jį nustatėte patys ir nenorite to keisti, galite tai padaryti.','Italian'=>'italų','Italy'=>'Italija','Jamaica'=>'Jamaika','Japan'=>'Japonija','JavaScript errors are detected on the front-end of your site. This may break the consent banner functionality.'=>'„JavaScript“ klaidos aptiktos jūsų svetainės priekinėje dalyje. Tai gali sutrikdyti sutikimo reklamjuostės funkciją.','Jersey'=>'Džersis','Jordan'=>'Jordanas','Kazakhstan'=>'Kazachstanas','Kenya'=>'Kenija','Kiribati'=>'Kiribatis','Korea'=>'Korėja','Kuwait'=>'Kuveitas','Kyrgyzstan'=>'Kirgizija','LGPD'=>'LGPD','Lao People\'s Democratic Republic'=>'Laoso Liaudies Demokratinė Respublika','Last error in the console:'=>'Paskutinė klaida konsolėje:','Last site scan completed on %s.'=>'Paskutinis svetainės nuskaitymas baigtas %s.','Latvia'=>'Latvija','Learn more'=>'Sužinokite daugiau','Learn more about our features!'=>'Sužinokite daugiau apie mūsų funkcijas!','Learn more about using cookieless tracking with Matomo.'=>'Sužinokite daugiau apie stebėjimo be slapukų naudojimą su Matomo.','Leave a review'=>'Palikite atsiliepimą','Lebanon'=>'Libanas','Left'=>'Kairė','Legal Document'=>'Teisinis dokumentas','Legal Hub'=>'Teisinis centras','Legal compliance for webshops.'=>'Internetinių parduotuvių teisinė atitiktis.','Legal documentWebsite'=>'Interneto svetainė','Legal documentconfirmation of the existence of processing;'=>'patvirtinimas, kad tvarkoma;','Legal document cookie policyA cookie is a small simple file that is sent along with pages of this website and stored by your browser on the hard drive of your computer or another device. The information stored therein may be returned to our servers or to the servers of the relevant third parties during a subsequent visit.'=>'Slapukas yra mažas paprastas failas, kuris siunčiamas kartu su šios svetainės puslapiais ir išsaugomas jūsų naršyklės jūsų kompiuterio ar kito įrenginio standžiajame diske. Jame saugoma informacija gali būti grąžinta į mūsų arba atitinkamų trečiųjų šalių serverius vėlesnio apsilankymo metu.','Legal document cookie policyA script is a piece of program code that is used to make our website function properly and interactively. This code is executed on our server or on your device.'=>'Scenarijus yra programos kodo dalis, kuri naudojama tam, kad mūsų svetainė veiktų tinkamai ir interaktyviai. Šis kodas vykdomas mūsų serveryje arba jūsų įrenginyje.','Legal document cookie policyA web beacon (or a pixel tag) is a small, invisible piece of text or image on a website that is used to monitor traffic on a website. In order to do this, various data about you is stored using web beacons.'=>'Žiniatinklio švyturys (arba pikselių žyma) yra maža, nematoma teksto arba vaizdo dalis svetainėje, naudojama srautui svetainėje stebėti. Tam naudojant žiniatinklio švyturius saugomi įvairūs duomenys apie jus.','Legal document cookie policyBecause statistics are being tracked anonymously, no permission is asked to place statistics cookies.'=>'Kadangi statistika sekama anonimiškai, leidimo talpinti statistikos slapukus neprašoma.','Legal document cookie policyBecause these cookies are marked as tracking cookies, we ask your permission to place these.'=>'Kadangi šie slapukai pažymėti kaip sekimo slapukai, prašome jūsų leidimo juos talpinti.','Legal document cookie policyEmail:'=>'El. paštas:','Legal document cookie policyFor questions and/or comments about our Cookie Policy and this statement, please contact us by using the following contact details:'=>'Jei turite klausimų ir (arba) komentarų apie mūsų slapukų politiką ir šį pareiškimą, susisiekite su mumis šiais kontaktiniais duomenimis:','Legal document cookie policyIf you give us your consent to process your data, you have the right to revoke that consent and to have your personal data deleted.'=>'Jei duodate mums sutikimą tvarkyti jūsų duomenis, turite teisę atšaukti šį sutikimą ir reikalauti, kad jūsų asmens duomenys būtų ištrinti.','Legal document cookie policyOn our website, we have included content from %s to promote web pages (e.g. “like”, “pin”) or share (e.g. “tweet”) on social networks like %s. This content is embedded with code derived from %s and places cookies. This content might store and process certain information for personalized advertising.'=>'Į savo svetainę įtraukėme %s turinio, skirto tinklalapiams reklamuoti (pvz., „patinka“, „smeigtukas“) arba bendrinti (pvz., „twitter“) socialiniuose tinkluose, pvz., %s. Šis turinys yra įterptas su kodu, gautu iš %s, ir jame yra slapukų. Šiame turinyje gali būti saugoma ir apdorota tam tikra informacija, skirta suasmenintam reklamavimui.','Legal document cookie policyOn our website, we have included content to promote web pages (e.g. “like”, “pin”) or share (e.g. “tweet”) on social networks. This content is embedded with code derived from third parties and places cookies. This content might store and process certain information for personalized advertising.'=>'Į savo svetainę įtraukėme turinį, skirtą tinklalapiams reklamuoti (pvz., „patinka“, „prisegti“) arba bendrinti (pvz., „twitter“) socialiniuose tinkluose. Šis turinys yra įterptas iš trečiųjų šalių gauto kodo ir talpina slapukus. Šiame turinyje gali būti saugoma ir apdorota tam tikra informacija, skirta suasmenintam reklamavimui.','Legal document cookie policyOn this website we use advertising cookies, enabling us to gain insights into the campaign results. This happens based on a profile we create based on your behavior on %s. With these cookies you, as website visitor, are linked to a unique ID but these cookies will not profile your behavior and interests to serve personalized ads.'=>'Šioje svetainėje naudojame reklaminius slapukus, leidžiančius gauti įžvalgų apie kampanijos rezultatus. Tai atsitinka pagal profilį, kurį sukuriame pagal jūsų elgesį %s. Naudodami šiuos slapukus jūs, kaip svetainės lankytojas, esate susieti su unikaliu ID, tačiau šie slapukai neprofiluos jūsų elgesio ir pomėgių teikti suasmenintus skelbimus.','Legal document cookie policyOn this website we use advertising cookies, enabling us to personalize the advertisements for you, and we (and third parties) gain insights into the campaign results. This happens based on a profile we create based on your click and surfing on and outside %s. With these cookies you, as website visitor are linked to a unique ID, so you do not see the same ad more than once for example.'=>'Šioje svetainėje naudojame reklaminius slapukus, kurie leidžia jums pritaikyti reklamas, o mes (ir trečiosios šalys) gauname įžvalgų apie kampanijos rezultatus. Tai atsitinka pagal profilį, kurį sukuriame pagal jūsų paspaudimus ir naršymą %s ir už jo ribų. Su šiais slapukais jūs, kaip svetainės lankytojas, esate susieti su unikaliu ID, todėl, pavyzdžiui, tą patį skelbimą nematysite daugiau nei vieną kartą.','Legal document cookie policyOur website, %s (hereinafter: "the website") uses cookies and other related technologies (for convenience all technologies are referred to as "cookies"). Cookies are also placed by third parties we have engaged. In the document below we inform you about the use of cookies on our website.'=>'Mūsų svetainė %s (toliau: "svetainė") naudoja slapukus ir kitas susijusias technologijas (patogumui visos technologijos vadinamos "slapukais"). Slapukus taip pat talpina trečiosios šalys, su kuriomis mes įtraukėme. Žemiau esančiame dokumente informuojame apie slapukų naudojimą mūsų svetainėje.','Legal document cookie policyPlease note that our website may not work properly if all cookies are disabled. If you do delete the cookies in your browser, they will be placed again after your consent when you visit our website again.'=>'Atkreipkite dėmesį, kad mūsų svetainė gali tinkamai neveikti, jei išjungti visi slapukai. Jei ištrinsite slapukus iš savo naršyklės, jie bus vėl patalpinti po jūsų sutikimo, kai vėl apsilankysite mūsų svetainėse.','Legal document cookie policyRight of access: You have the right to access your personal data that is known to us.'=>'Teisė susipažinti su: Jūs turite teisę susipažinti su mums žinomais savo asmens duomenimis.','Legal document cookie policyRight to object: you may object to the processing of your data. We comply with this, unless there are justified grounds for processing.'=>'Teisė nesutikti: galite nesutikti, kad būtų tvarkomi jūsų duomenys. Mes to laikomės, nebent yra pagrįstų priežasčių juos tvarkyti.','Legal document cookie policyRight to rectification: you