rėdami pasinaudoti šiomis teisėmis, susisiekite su mumis. Kontaktinius duomenis rasite šios slapukų politikos apačioje. Jei turite nusiskundimų dėl to, kaip tvarkome jūsų duomenis, norėtume išgirsti jūsų nuomonę.','Legal document cookie policyWe ask your permission to place statistics cookies.'=>'Mes prašome jūsų leidimo talpinti statistinius slapukus.','Legal document cookie policyWe have made agreements about the use of cookies with other companies that place cookies. However, we cannot guarantee that these third parties handle your personal data in a reliable or secure manner. Parties such as Google are to be considered as independent data controllers. We recommend that you read the privacy statements of these companies.'=>'Esame sudarę sutartis dėl slapukų naudojimo su kitomis įmonėmis, kurios talpina slapukus. Tačiau negalime garantuoti, kad šios trečiosios šalys jūsų asmens duomenis tvarkys patikimai ar saugiai. Tokios šalys kaip „Google“ turi būti laikomos nepriklausomais duomenų valdytojais. Rekomenduojame perskaityti šių įmonių privatumo pareiškimus.','Legal document cookie policyWe use %s for %s.'=>'%s naudojame %s.','Legal document cookie policyWe use statistics cookies to optimize the website experience for our users. With these statistics cookies we get insights in the usage of our website.'=>'Naudojame statistinius slapukus siekdami optimizuoti savo vartotojų patirtį svetainėje. Naudodamiesi šiais statistikos slapukais gauname įžvalgų apie mūsų svetainės naudojimą.','Legal document cookie policyWebsite:'=>'Interneto svetainė:','Legal document cookie policyWhen you visit our website for the first time, we will show you a pop-up with an explanation about cookies. As soon as you click on "%s", you consent to us using all cookies and plug-ins as described in the pop-up and this Cookie Policy. You can disable the use of cookies via your browser, but please note that our website may no longer work properly.'=>'Kai apsilankysite mūsų svetainėje pirmą ka