ernet browser so that you receive a message each time a cookie is placed. For more information about these options, please refer to the instructions in the Help section of your browser.'=>'Galite naudoti savo interneto naršyklę automatiškai arba rankiniu būdu ištrinti slapukus. Taip pat galite nurodyti, kad tam tikri slapukai negali būti talpinami. Kita galimybė – pakeisti savo interneto naršyklės nustatymus, kad kiekvieną kartą įdėjus slapuką gautumėte pranešimą. Daugiau informacijos apie šias parinktis rasite naršyklės žinyno skiltyje pateiktose instrukcijose.','Legal document cookie policyYou can use your internet browser to automatically or manually delete cookies. You can also specify that certain cookies may not be placed. Another option is to change the settings of your internet browser so that you receive a message each time a cookie is placed. For more information about these options, please refer to the instructions in the Help section of your browser. Or you can indicate your preferences on the following page: %syouradchoices.ca%s'=>'Galite naudoti savo interneto naršyklę automatiškai arba rankiniu būdu ištrinti slapukus. Taip pat galite nurodyti, kad tam tikri slapukai negali būti talpinami. Kita galimybė – pakeisti savo interneto naršyklės nustatymus, kad kiekvieną kartą įdėjus slapuką gautumėte pranešimą. Daugiau informacijos apie šias parinktis rasite naršyklės žinyno skiltyje pateiktose instrukcijose. Arba galite nurodyti savo pageidavimus šiame puslapyje: %syouradchoices.ca%s','Legal document cookie policyYou have the following rights with respect to your personal data:'=>'Jūs turite šias teises, susijusias su savo asmens duomenimis:','Legal document cookie policyYou have the right to address a challenge concerning non-compliance with PIPEDA to our organization and, if the issue is not resolved, to the Office of the Privacy Commissioner of Canada.'=>'Jūs turite teisę kreiptis į mūsų organizaciją ir, jei problema neišspręsta, į Kanados Privatumo komisaro biurą su iššūkiu dėl PIPEDA nesilaikymo.','Legal document cookie policyYou have the right to know why your personal data is needed, what will happen to it, and how long it will be retained for.'=>'Jūs turite teisę žinoti, kodėl jūsų asmens duomenys reikalingi, kas su jais atsitiks ir kiek laiko jie bus saugomi.','Legal document cookie policyYou have the right to withdraw consent at any time, subject to legal or contractual restrictions and reasonable notice. You will be informed of the implications of such withdrawal.'=>'Jūs turite teisę bet kuriuo metu atšaukti sutikimą, atsižvelgdami į teisinius ar sutartinius apribojimus ir pagrįstą įspėjimą. Jūs būsite informuoti apie tokio atsisakymo pasekmes.','Legal document cookie policyaccess to data;'=>'prieiga prie duomenų;','Legal document cookie policyanonymization, blocking, or deletion of unnecessary, excessive, or processed data in disagreement with the provisions of the General Law for the Protection of Personal Data (LGPD);'=>'nereikalingų, perteklinių arba tvarkomų duomenų anonimiškumas, blokavimas ar ištrynimas, nesutinkant su Bendrojo asmens duomenų apsaugos įstatymo (BPD) nuostatomis;','Legal document cookie policycorrection of incomplete, inaccurate, or outdated data;'=>'neišsamių, netikslių ar pasenusių duomenų ištaisymas;','Legal document cookie policydeletion of personal data processed with the consent of the holder, except in the cases provided for in art. 16 of the General Law for the Protection of Personal Data (LGPD);'=>'turėtojo sutikimu tvarkomų asmens duomenų ištrynimas, išskyrus atvejus, numatytus str. Bendrojo asmens duomenų apsaugos įstatymo (LGPD) 16 str.;','Legal document cookie policyinformation on public and private entities with which the controller shared data;'=>'informacija apie viešuosius ir privačius subjektus, su kuriais duomenų valdytojas dalijosi duomenimis;','Legal document cookie policyinformation on the possibility of not providing consent and on the consequences of