for money or services. This includes a service like Google Analytics.'=>'Svetainės nuskaitymas aptiko slapukus iš paslaugų, kurios dalijasi duomenimis su trečiosiomis šalimis. Pagal JAV privatumo įstatymus laikoma, kad jūsų svetainė parduoda asmens duomenis, jei joje renkami ir bendrinami bet kokie asmens duomenys mainais už pinigus ar paslaugas. Tai apima tokią paslaugą kaip „Google Analytics“.','The site scan detected cookies from services which share data with Third Parties. If these cookies were also used in the past 12 months, you should at least select the option \'Internet activity...\''=>'Svetainės nuskaitymas aptiko slapukus iš paslaugų, kurios dalijasi duomenimis su trečiosiomis šalimis. Jei šie slapukai taip pat buvo naudojami per pastaruosius 12 mėnesių, turėtumėte bent pasirinkti parinktį „Interneto veikla...“','The tab will show after the visitor interacted with the banner, and can be used to make the consent banner reappear.'=>'Skirtukas bus rodomas lankytojui sąveikaujant su reklamjuoste ir gali būti naudojamas sutikimo reklamjuostei vėl pasirodyti.','The technical storage or access is necessary for the legitimate purpose of storing preferences that are not requested by the subscriber or user.'=>'Techninė saugykla arba prieiga yra būtina teisėtam tikslui išsaugoti nuostatas, kurių neprašo abonentas ar vartotojas.','The technical storage or access is required to create user profiles to send advertising, or to track the user on a website or across several websites for similar marketing purposes.'=>'Techninė saugykla arba prieiga reikalinga norint sukurti naudotojo profilius reklamai siųsti arba sekti vartotoją svetainėje ar keliose svetainėse panašiais rinkodaros tikslais.','The technical storage or access is strictly necessary for the legitimate purpose of enabling the use of a specific service explicitly requested by the subscriber or user, or for the sole purpose of carrying out the transmission of a communication over an electronic communications network.'=>'Techninė saugykla arba prieiga yra griežtai būtina siekiant teisėto tikslo – sudaryti sąlygas naudotis konkrečia paslauga, kurios aiškiai paprašė abonentas arba naudotojas, arba tik tam, kad būtų galima perduoti ryšį elektroninių ryšių tinklu.','The technical storage or access that is used exclusively for anonymous statistical purposes. Without a subpoena, voluntary compliance on the part of your Internet Service Provider, or additional records from a third party, information stored or retrieved for this purpose alone cannot usually be used to identify you.'=>'Techninė saugykla arba prieiga, kuri naudojama tik anoniminiais statistikos tikslais. Be teismo šaukimo, jūsų interneto paslaugų teikėjo savanoriško įsipareigojimo ar papildomų įrašų iš trečiosios šalies, vien šiuo tikslu saugoma ar gauta informacija paprastai negali būti naudojama jūsų tapatybei nustatyti.','The technical storage or access that is used exclusively for statistical purposes.'=>'Techninė saugykla arba prieiga, kuri naudojama tik statistiniais tikslais.','The wizard is currently being edited by %s'=>'Šiuo metu vedlį redaguoja %s','The wizard isn\'t completed yet. If you have answered all required questions, you just need to click \'finish\' to complete it. In the wizard some general data is entered which is needed for this document. %sPlease complete the wizard first%s.'=>'Vedlys dar nebaigtas. Jei atsakėte į visus būtinus klausimus, tereikia spustelėti „Baigti“, kad jį užbaigtumėte. Vedlyje įvedami kai kurie bendrieji duomenys, reikalingi šiam dokumentui. %sPirmiausia užbaikite vedlį%s.','There are some laws that only apply to one or more states and are described separately if needed.'=>'Kai kurie įstatymai taikomi tik vienai ar kelioms valstybėms ir, jei reikia, aprašomi atskirai.','These are the main options to customize your consent banner. To go even further you can use our documentation on complianz.io for CSS Lessons, or even start from scratch and create your own with just HTML and CSS.'=>'Tai yra pagrindinės sutikimo reklamjuostės tinkinimo parinktys. Norėdami eiti dar toliau, galite naudoti mūsų dokumentus, esančius complianz.io, skirtus CSS pamokoms, arba net pradėti nuo nulio ir sukurti savo naudodami tik HTML ir CSS.','These links will be added with HTML attributes so it won\'t hurt SEO.'=>'Šios nuorodos bus pridėtos su HTML atributais, todėl tai nepakenks SEO.','Third Party country'=>'Trečiosios šalies šalis','Third-party cookies'=>'Trečiųjų šalių slapukai','This appears to be an invalid license key for this plugin.'=>'Atrodo, kad tai netinkamas šio papildinio licencijos raktas.','This button will reject all cookies except necessary cookies, and dismisses the consent banner.'=>'Šis mygtukas atmes visus slapukus, išskyrus būtinus slapukus, ir atsisakys sutikimo reklamjuostės.','This can improve conversion accuracy, but can contain personal data like a client ID.'=>'Tai gali pagerinti konversijų tikslumą, tačiau gali būti asmens duomenų, pvz., kliento ID.','This could break website functionality.'=>'Tai gali sutrikdyti svetainės funkcionalumą.','This data is not shared with third parties.'=>'Šie duomenys nėra bendrinami su trečiosiomis šalimis.','This document was generated to show efforts made to comply with privacy legislation.
                            This document will contain the Cookie Policy and the cookie consent settings to proof consent
