                             į %shttps://complianz.io/consent%s.','This email is confirmation that any email notices are likely to reach your inbox.'=>'Šis el. laiškas yra patvirtinimas, kad bet kokie el. pašto pranešimai greičiausiai pasieks jūsų gautuosius.','This email is part of the Complianz Notification System'=>'Šis el. laiškas yra „Complianz“ pranešimų sistemos dalis','This email was sent to'=>'Šis el. laiškas buvo išsiųstas','This feature includes real-time cookie removal with the CookieShredder.'=>'Ši funkcija apima slapukų pašalinimą realiuoju laiku naudojant „CookieShredder“.','This field is required. Please complete the question before continuing'=>'Šį lauką būtina užpildyti. Prieš tęsdami užpildykite klausimą','This is useful if you have a multisite, or several sites as subdomains on a main site'=>'Tai naudinga, jei pagrindinėje svetainėje turite kelias svetaines arba kelias svetaines kaip subdomenus','This message was generated by Complianz GDPR/CCPA.'=>'Šį pranešimą sugeneravo Complianz BDAR/CCPA.','This option is recommended in combination with TCF and will store consent data in your database.'=>'Ši parinktis rekomenduojama kartu su SSP ir išsaugos sutikimo duomenis jūsų duomenų bazėje.','This script contains an async attribute.'=>'Šiame scenarijuje yra asinchroninis atributas.','This service does not process any personally identifiable information and does not share any data with the service provider.'=>'Ši paslauga neapdoroja jokios asmenį identifikuojančios informacijos ir nesidalina jokiais duomenimis su paslaugos teikėju.','This setting is automatically selected based on your WordPress language setting.'=>'Šis nustatymas automatiškai parenkamas pagal jūsų „WordPress“ kalbos nustatymą.','This should be your main, root domain.'=>'Tai turėtų būti jūsų pagrindinis, šakninis domenas.','This style is for the checkboxes on the consent banner, as well as on your policy for managing consent.'=>'Šis stilius skirtas sutikimo reklamjuostės žymimiesiems laukeliams, taip pat sutikimo tvarkymo politikai.','This website uses the Privacy Suite for WordPress by Complianz to collect and record Browser and Device-based Consent. For this functionality, your IP address is anonymized and stored in our database.'=>'Ši svetainė naudoja „Complianz“ skirtą „WordPress“ privatumo rinkinį, kad rinktų ir įrašytų naršyklės ir įrenginio sutikimą. Šiai funkcijai jūsų IP adresas yra anonimizuotas ir saugomas mūsų duomenų bazėje.','This will apply an opt-in mechanism for all visitors from Canada, as required by Quebec bill 64.'=>'Taip visiems lankytojams iš Kanados bus taikomas pasirinkimo mechanizmas, kaip reikalaujama Kvebeko įstatymo Nr. 64.','This will be fired on marketing consent.'=>'Neprivaloma, tai bus paleista gavus rinkodaros sutikimą.','This will disable a back-end javascript to keep the banner width aligned with other elements.'=>'Taip bus išjungtas galinis JavaScript, kad reklamjuostės plotis būtų suderintas su kitais elementais.','This will enable Data Requests Forms for your Privacy Statements.'=>'Tai įgalins duomenų užklausų formas jūsų privatumo pareiškimams.','This will reset all settings to defaults. All data in the Complianz plugin will be deleted!'=>'Tai iš naujo nustatys visus numatytuosius nustatymus. Visi Complianz papildinio duomenys bus ištrinti!','Timeout in seconds'=>'Skirtasis laikas sekundėmis','Timor-Leste'=>'Rytų Timoras','Tips & Tricks'=>'patarimai ir triukai','To be able to comply with legal obligations'=>'Gebėti vykdyti teisinius įsipareigojimus','To be able to offer personalized products and services'=>'Galimybė pasiūlyti individualizuotus produktus ir paslaugas','To change these settings, please visit the script center.'=>'Norėdami pakeisti šiuos nustatymus, apsilankykite scenarijų centre.','To learn what Data Breach Reports are and what you need them for, please read the below article'=>'Norėdami sužinoti, kas yra duomenų pažeidimo ataskaitos ir kam jos jums reikalingos, perskaitykite toliau pateiktą straipsnį','To learn what Processing Agreements are and what you need them for, please read the below article'=>'Norėdami sužinoti, kas yra apdorojimo sutartys ir kam jos reikalingos, perskaitykite toliau pateiktą straipsnį','To provide the best experiences, we use technologies like cookies to store and/or access device information. Consenting to these technologies will allow us to process data such as browsing behavior or unique IDs on this site. Not consenting or withdrawing consent, may adversely affect certain features and functions.'=>'Siekdami teikti geriausią patirtį, įrenginio informacijai saugoti ir (arba) pasiekti naudojame tokias technologijas kaip slapukus. Jei sutiksime su šiomis technologijomis, galėsime apdoroti duomenis, tokius kaip naršymo elgsena arba unikalūs ID šioje svetainėje. Nesutikimas arba sutikimo atšaukimas gali neigiamai paveikti tam tikras funkcijas ir funkcijas.','To sell or share data with a third party'=>'Norėdami parduoti arba dalytis duomenimis su trečiąja šalimi','To submit this form, you need to accept our %sPrivacy Statement%s'=>'Norėdami pateikti šią formą, turite sutikti su mūsų %sprivatumo pareiškimu%s','To submit this form, you need to accept our Privacy Statement'=>'Norėdami pateikti šią formą, turite sutikti su mūsų privatumo pareiškimu','To support services or products that a customer wants to buy or has purchased'=>'Palaikyti paslaugas ar produktus, kuriuos klientas nori įsigyti arba įsigijo','Toggles'=>'Perjungia','Togo'=>'Eiti','Tokelau'=>'Tokelau','Tonga'=>'Tonga','Tools'=>'Įrankiai','Top'=>'Viršus','Tracking ID'=>'Stebėjimo ID','Trinidad And Tobago'=>'Trinidadas ir Tobagas','Tunisia'=>'Tunisas','Turkey'=>'Turkija','Turkmenistan'=>'Turkmėnistanas','Turks And Caicos Islands'=>'Terkso ir Kaikoso salos','Tuvalu'=>'Tuvalu','UK'=>'JK','UK-GDPR'=>'JK-BDAR','URLs that should be blocked before consent.'=>'URL, kurie turėtų būti užblokuoti prieš sutikimą.','URLs that should be whitelisted.'=>'URL, kurie turėtų būti įtraukti į ba