s, JAV','Virginia (CDPA)'=>'Virdžinija (CDPA)','Visit Dashboard'=>'Apsilankykite informacijos suvestinėje','Visitors'=>'Lankytojai','Wallis And Futuna'=>'Wallis ir Futuna','We connect to this open-source database using an external API, which sends the results of the cookiescan (a list of found cookies, used plugins and your domain) to cookiedatabase.org, for the sole purpose of providing you with accurate descriptions and keeping them up-to-date on a regular basis.'=>'Prisijungiame prie šios atvirojo kodo duomenų bazės naudodami išorinę API, kuri siunčia slapukų nuskaitymo rezultatus (rastų slapukų sąrašą, naudotus papildinius ir jūsų domeną) į cookiedatabase.org, kad būtų galima pateikti tikslius aprašymus ir išsaugoti. juos reguliariai atnaujina.','We have added additional support and recommend reviewing your settings.'=>'Pridėjome papildomo palaikymo ir rekomenduojame peržiūrėti settings.','We have detected the %s plugin on your website.'=>'Jūsų svetainėje aptikome %s papildinį.','We have detected the below plugins.'=>'Mes aptikome toliau pateiktus papildinius.','We have enabled integrations for plugins and services, please double-check your configuration.'=>'Įgalinome papildinių ir paslaugų integravimą, dar kartą patikrinkite konfigūraciją.','We have enabled the integrations and possible placeholders.'=>'Įgalinome integracijas ir galimus vietos rezervavimo ženklus.','We have received your request'=>'Gavome jūsų užklausą','We have received your request on {blogname}. Depending on the specific request and legal obligations we might follow-up.'=>'Gavome jūsų užklausą {blogname}. Atsižvelgdami į konkretų prašymą ir teisinius įsipareigojimus, galime imtis tolesnių veiksmų.','We need some information to be able to generate your Imprint. Not all fields are required.'=>'Mums reikia tam tikros informacijos, kad galėtume sukurti jūsų spaudą. Ne visi laukai yra būtini.','We need some information to be able to generate your documents and configure your consent banner.'=>'Mums reikia tam tikros informacijos, kad galėtume sugeneruoti dokumentus ir sukonfigūruoti sutikimo reklamjuostę.','We see you have enabled Google Maps as a service, but we can\'t find an integration. You can integrate manually if needed.'=>'Matome, kad įgalinote „Google“ žemėlapius kaip paslaugą, bet negalime rasti integravimo. Jei reikia, galite integruoti rankiniu būdu.','We use technologies like cookies to store and/or access device information. We do this to improve browsing experience and to show (non-) personalized ads. Consenting to these technologies will allow us to process data such as browsing behavior or unique IDs on this site. Not consenting or withdrawing consent, may adversely affect certain features and functions.'=>'Įrenginio informacijai saugoti ir (arba) pasiekti naudojame tokias technologijas kaip slapukai. Tai darome siekdami pagerinti naršymo patirtį ir rodyti suasmenintus skelbimus. Jei sutiksime su šiomis technologijomis, galėsime apdoroti duomenis, tokius kaip naršymo elgsena arba unikalūs ID šioje svetainėje, ir rodyti (ne)personalizuotus skelbimus. Nesutikimas arba sutikimo atšaukimas gali neigiamai paveikti tam tikras funkcijas ir funkcijas.','We will add the needed snippets and control consent at the same time.'=>'Tuo pačiu metu pridėsime reikiamus fragmentus ir kontroliuosime sutikimą.','Website information'=>'Svetainės informacija','Western Sahara'=>'Vakarų Sachara','What are data request forms?'=>'Kas yra duomenų užklausos formos?','What are records of consent?'=>'Kas yra sutikimo įrašai?','What is the address where complaints or inquiries can be forwarded?'=>'Kokiu adresu galima siųsti skundus ar paklausimus?','What is the email address your visitors can use to contact you about privacy issues?'=>'Kokį el. pašto adresą lankytojai gali naudoti norėdami susisiekti su jumis privatumo klausimais?','What is the telephone number your visitors can use to contact you about privacy issues?'=>'Koks yra telefono numeris, kuriuo lankytojai gali susisiekti su jumis privatumo klausimais?','What is your address?'=>'Koks jūsų adresas?','What is your country?'=>'Kokia yra tavo šalis?','What now?'=>'Kas dabar?','What type of data is shared'=>'Kokio tipo duomenys bendrinami','When checking all three checkboxes, we will set statistics to anonymous. Based on your region, statistics might be set before consent.'=>'Pažymėdami visus tris žymimuosius laukelius, statistiką nustatysime kaip anoniminę. Atsižvelgiant į jūsų regioną, statistika gali būti nustatyta prieš sutikimą.','When content is loaded with ajax, for example with a load more button or lightbox, this option could help blocking the service correctly'=>'Kai turinys įkeliamas naudojant ajax, pavyzdžiui, su įkelti daugiau mygtuku arba šviesos dėžute, ši parinktis gali padėti tinkamai užblokuoti paslaugą','When dismiss on scroll is enabled, the consent banner will be dismissed as soon as the user scrolls.'=>'Kai įgalintas atsisakymas slenkant, sutikimo reklamjuostė bus atmesta, kai tik naudotojas slinks.','When dismiss on time out is enabled, the consent banner will be dismissed after 10 seconds, or the time you choose below.'=>'Kai įgalintas atmetimo laikas, sutikimo reklamjuostė bus atmesta po 10 sekundžių arba toliau pasirinkto laiko.','When emails are sent, you can choose the sender email address here. Please note that it should have this website\'s domain as sender domain, otherwise the server might block the email from being sent.'=>'Kai siunčiami el. laiškai, čia galite pasirinkti siuntėjo el. pašto adresą. Atminkite, kad šios svetainės domenas turėtų būti siuntėjo domenas, nes priešingu atveju serveris gali užblokuoti el. laiškų siuntimą.','When enabled, cookies will no longer be set when ad_storage is denied and identifiers in network requests will be redacted.'=>'Kai įjungta, slapukai nebebus nustatomi, kai atmetamas ad_storage, o tinklo užklausų identifikatoriai bus ištrinti.','When enabled, this is the consent banner that is used for all visitors. Enabling it will disable this setting on the current default banner. Disabling it will enable randomly a different default banner.'=>'Kai įjungta, tai sutikimo reklamjuostė, kuri naudojama visiems lankytojams. Jį įjungus šis nustatymas bus išjungtas dabartinėje numatytojoje reklamjuostėje. Ją išjungus atsitiktinai bus įjungta kita numatytoji reklamjuostė.','When possible a placeholder is activated. You can also disable or configure the placeholder to your liking. You can disable services and placeholders under Integrations.'=>'Kai įmanoma, suaktyvinamas vietos rezervavimo ženklas. Taip pat galite išjungti arba konfigūruoti rezervuotą vietą pagal savo skonį. Galite išjungti paslaugas ir vietos žymeklius skiltyje Integracijos.','When safe mode is enabled, all integrations will be disabled temporarily, please read the instructions to debug the issue or ask support if needed.'=>'Įjungus saugųjį režimą, visos integracijos bus laikinai išjungtos. Perskaitykite šias instrukcijas, kad ištaisytumėte problemą arba kreipkitės pagalbos, jei reikia.','Which banner do you want to display in other regions?'=>'Kurią reklamjuostę norite rodyti kituose regionuose?','Which privacy law or guideline do you want to use as the default for your worldwide visitors?'=>'Kurį privatumo įstatymą ar gaires norite naudoti kaip numatytąjį savo lankytojams visame pasaulyje?','Which region(s) do I target?'=>'Į kurį (-ius) regioną (-us) orientuojuosi?','Which region(s) do you target with your website?'=>'Į kurį (-ius) regioną (-ius) taikote savo svetainėje?','Who is the owner of the website?'=>'Kas yra svetainės savininkas?','Width of the banner in pixels'=>'Reklamjuostės plotis pikseliais','Will you be using our Tag Manager template?'=>'Ar naudosite mūsų Žymų tvarkytuvės šabloną?','Will you self-host Google Fonts?'=>'Ar patys priglobsite „Google“ šriftus?','With Matomo cookieless tracking, configuration by Complianz is required.'=>'Naudojant Matomo stebėjimą be slapukų, reikalinga Complianz konfigūracija.','With categories, you can let users choose which category of cookies they want to accept.'=>'Naudodami kategorijas galite leisti vartotojams pasirinkti, kurią slapukų kategoriją jie nori priimti.','Without the API, you will have to manually describe all found cookies, their purpose, function, service and service types. '=>'Be API turėsite rankiniu būdu aprašyti visus rastus slapukus, jų paskirtį, funkciją, paslaugą ir paslaugų tipus.','Wizard'=>'Vedlys','WordPress comments'=>'WordPress komentarai','Yemen'=>'Jemenas','Yes'=>'Taip','Yes (recommended)'=>'Taip (rekomenduojama)','Yes, I agree with the %sPrivacy Statement%s'=>'Taip, sutinku su %sprivatumo pareiškimu%s','Yes, I agree with the %sprivacy statement%s'=>'Taip, sutinku su %s privatumo pareiškimu%s','Yes, and Google Tag Manager fires this script'=>'Taip, ir „Google“ žymų tvarkyklė suaktyvina šį scenarijų','Yes, and Matomo Tag Manager fires this script'=>'Taip, „Matomo Tag Manager“ suaktyvina šį scenarijų','Yes, but not with any of the above services'=>'Taip, bet ne su jokia iš aukščiau išvardytų paslaugų','Yes, redirect based on GEO IP'=>'Taip, peradresuoti pagal GEO IP','Yes, with Clarity'=>'Taip, su Clarity','Yes, with Clicky'=>'Taip, su Clicky','Yes, with Google Analytics'=>'Taip, su Google Analytics','Yes, with Matomo'=>'Taip, su Matomo','Yes, with Yandex'=>'Taip, su „Yandex','You can add additional custom CSS here. For tips and CSS lessons, check out our documentation.'=>'Čia galite pridėti papildomų tinkintų CSS. Norėdami gauti patarimų ir CSS pamokų, peržiūrėkite mūsų dokumentus.','You can add additional tags, comma separated.'=>'Galite pridėti papildomų žymų, atskirtų kableliais.','You can always enable and disable the Consent Banner when styling the Consent Banner, under Consent Banner settings.'=>'Sutikimo reklamjuostės stilių formuodami sutikimo reklamjuostės nustatymus visada galite įjungti ir išjungti sutikimo reklamjuostę.','You can change your placeholders manually or use Premium to do it for you.'=>'Vietos žymes galite pakeisti rankiniu būdu arba naudodami „Premium“, kad tai padarytumėte už jus.','You can choose the official Consent Mode template by Complianz from the template gallery, or use local initialization.'=>'Galite pasirinkti oficialų Complianz sutikimo režimo šabloną iš šablonų galerijos arba naudoti vietinį inicijavimą.','You can choose your favorite placeholder style here.'=>'Čia galite pasirinkti savo mėgstamą rezervuotos vietos stilių.','You can configure Google Tag Manager for Complianz, and, if applicable, adjust configuration for Google Analytics for GDPR and other opt-in based privacy laws.'=>'Galite konfigūruoti „Google“ žymų tvarkyklę, skirtą „Complianz“, ir, jei taikoma, koreguoti „Google Analytics“, skirtą BDAR, ir kitus pasirinkimu pagrįstus privatumo įstatymus.','You can configure Hotjar privacy-friendly, if you do this, no consent is required for Hotjar.'=>'Galite sukonfigūruoti „Hotjar“ privatumui draugišką, jei tai padarysite, „Hotjar“ sutikimas nereikalingas.','You can continue to the next step.'=>'Galite pereiti prie kito žingsnio.','You can upload your own logo, hide it, or use the site logo.'=>'Galite įkelti savo logotipą, paslėpti jį arba naudoti svetainės logotipą.','You can use GEO IP to enable the warning only for countries with a cookie law, or which you target'=>'Galite naudoti GEO IP, kad įgalintumėte įspėjimą tik tose šalyse, kuriose taikomas slapukų įstatymas arba kuriose taikote','You can use this to export your settings to another site'=>'Tai galite naudoti norėdami eksportuoti nustatymus į kitą svetainę','You can use this to import your settings from another site'=>'Tai galite naudoti norėdami importuoti nustatymus iš kitos svetainės','You don’t need to configure your website for ‘accidental’ visitors. Only choose the regions your website is intended for.'=>'Jums nereikia konfigūruoti savo svetainės „atsitiktiniams“ lankytojams. Pasirinkite tik tuos regionus, kuriems skirta jūsų svetainė.','You have %s installed. We recommend saying \'Yes\' to self-hosting Google Fonts'=>'Įdiegėte %s. Rekomenduojame pasakyti „Taip“ savarankiškai priglobiantiems „Google“ šriftus','You have a duplicate implementation of your statistics tool on your site.'=>'Svetainėje du kartus įdiegtas statistikos įrankis.','You have an open data requests ready for response? Get started here.'=>'Ar turite atvirų duomenų užklausų, paruoštų atsakyti? Pradėkite čia.','You have chosen a custom Cookie Policy. The TCF option is disabled as it can only be used in combination with the Cookie Policy generated by Complianz.'=>'Jūs pasirinkote tinkintą slapukų politiką. SSPparinktis išjungta, nes ją galima naudoti tik kartu su Complianz sugeneruota slapukų politika.','You have cookies with incomplete descriptions.'=>'Turite slapukus su nepilnais aprašymais.','You have currently selected an informal language, which will result in informal use of language on the legal documents. If you prefer the formal style, you can activate this in the general settings.'=>'Šiuo metu pasirinkote neoficialią kalbą, dėl kurios teisiniuose dokumentuose bus vartojama neoficiali kalba. Jei jums labiau patinka formalus stilius, galite tai suaktyvinti bendruosiuose nustatymuose.','You have enabled TCF. This option can only be used in combination with the Cookie Policy generated by Complianz.'=>'Įgalinote SSP. Ši parinktis gali būti naudojama tik kartu su Complianz sukurta slapukų politika.','You have enabled a feature on %s. We think it\'s important to let you know a little bit more about this feature so you can use it without worries.'=>'Įjungėte funkciją %s. Manome, kad svarbu šiek tiek daugiau sužinoti apie šią funkciją, kad galėtumėte ja naudotis be rūpesčių.','You have open data requests.'=>'Turite atvirų duomenų užklausų.','You have received a new data request on %s'=>'Gavote naują duomenų užklausą %s','You have selected options that indicate your site processes sensitive, personal data. You should select \'Yes\''=>'Pasirinkote parinktis, kurios nurodo, kad jūsų svetainė apdoroja neskelbtinus asmeninius duomenis. Turėtumėte pasirinkti „Taip“','You have selected you anonymize IP addresses. This setting is now enabled in %s.'=>'Pasirinkote anonimizuoti IP adresus. Šis nustatymas dabar įjungtas %s.','You have selected you anonymize IP addresses. This setting is now enabled in Beehive.'=>'Pasirinkote anonimizuoti IP adresus. Šis nustatymas dabar įgalintas „Beehive“.','You have selected you anonymize IP addresses. This setting is now enabled in MonsterInsights.'=>'Pasirinkote anonimizuoti IP adresus. Šis nustatymas dabar įgalintas MonsterInsights.','You have selected you do not share data with third-party networks. Demographics is now disabled in MonsterInsights.'=>'Pasirinkote, kad nesidalinate duomenimis su trečiųjų šalių tinklais. Dabar „MonsterInsights“ demografiniai rodikliai išjungti.','You have selected you do not share data with third-party networks. Display advertising is now disabled in %s.'=>'Pasirinkote, kad nesidalinate duomenimis su trečiųjų šalių tinklais. Vaizdo reklamavimas dabar išjungtas %s.','You have selected you do not share data with third-party networks. Display advertising is now disabled in Beehive.'=>'Pasirinkote, kad nesidalinate duomenimis su trečiųjų šalių tinklais. Vaizdo reklama dabar „Beehive“ išjungta.','You have selected you do not share data with third-party networks. Remarketing is now disabled in %s.'=>'Pasirinkote, kad nesidalinate duomenimis su trečiųjų šalių tinklais. Pakartotinė rinkodara dabar išjungta %s.','You have stated that you don\'t use third-party services. Do you use plugins that might set marketing cookies?'=>'Nurodėte, kad nesinaudojate trečiųjų šalių paslaugomis. Ar naudojate papildinius, kurie gali nustatyti rinkodaros slapukus?','You haven\'t accepted the usage of the cookiedatabase.org API. To automatically complete your cookie descriptions, please choose yes.'=>'Jūs nesutikote su cookiedatabase.org API naudojimu. Norėdami automatiškai užpildyti slapukų aprašus, pasirinkite taip.','You haven\'t selected any legal documents to create.'=>'Nepasirinkote jokių teisinių dokumentų, kuriuos norite sukurti.','You may remove it if you want.'=>'Jei norite, galite jį pašalinti.','You use %s, which means the answer to this question should be Google Analytics.'=>'Naudojate %s, o tai reiškia, kad atsakymas į šį klausimą turėtų būti Google Analytics.','You use %s, which means the answer to this question should be Google Tag Manager.'=>'Naudojate %s, o tai reiškia, kad atsakymas į šį klausimą turėtų būti „Google“ žymų tvarkyklė.','You use plugins which place first-party marketing cookies. Complianz cannot only block such cookies if the plugin conforms to the WP Consent API, or you have enabled Consent Per Service'=>'Naudojate papildinius, kurie talpina pirmosios šalies rinkodaros slapukus. „Complianz“ negali blokuoti tokių slapukų tik tuo atveju, jei papildinys atitinka WP sutikimo API arba įgalinote „Sutikimas paslaugai“','You will be redirected to our support form, with the needed information, automatically.'=>'Būsite automatiškai nukreipti į mūsų pagalbos formą su reikalinga informacija.','You\'re using Google Tag Manager. This means you need to configure Tag Manager to use the below categories.'=>'Naudojate „Google“ žymų tvarkytuvę. Tai reiškia, kad turite sukonfigūruoti Žymų tvarkytuvę, kad galėtumėte naudoti toliau nurodytas kategorijas.','Your PHP version is lower than the recommended PHP version. Some features are not available. Support for this PHP version will be dropped soon.'=>'Jūsų PHP versija yra senesnė nei rekomenduojama PHP versija. Kai kurios funkcijos nepasiekiamos. Šios PHP versijos palaikymas netrukus bus nutrauktas.','Your WordPress version does not support the functions needed for this step. You can upgrade to the latest WordPress version, or add the pages manually to a menu.'=>'Jūsų „WordPress“ versija nepalaiko šiam veiksmui reikalingų funkcijų. Galite atnaujinti į naujausią „WordPress“ versiją arba rankiniu būdu įtraukti puslapius į meniu.','Your documents have not been updated in the past 12 months. Run the wizard to check your settings.'=>'Jūsų dokumentai nebuvo atnaujinti per pastaruosius 12 mėnesių. Paleiskite vedlį, kad patikrintumėte nustatymus.','Your license is not active for this URL.'=>'Jūsų licencija šiam URL neaktyvi.','Your license key expired on %s.'=>'Jūsų licencijos rakto galiojimas baigėsi %s.','Your license key has been disabled.'=>'Jūsų licencijos raktas buvo išjungtas.','Your license key has reached its activation limit.'=>'Jūsų licencijos raktas pasiekė aktyvinimo limitą.','Your name'=>'Jūsų vardas','Your request could not be processed. A request is already in progress for this email address or the form is not complete.'=>'Jūsų užklausos apdoroti nepavyko. Užklausa dėl šio el. pašto adreso jau vykdoma arba forma neužpildyta.','Your request has been processed successfully!'=>'Jūsų užklausa sėkmingai apdorota!','Your site does not require a cookie banner. If you think you need a cookie banner, please review your wizard settings.'=>'Jūsų svetainė nereikalauja slapukų reklamjuostės. Jei manote, kad jums reikia slapukų reklamjuostės, peržiūrėkite vedlio nustatymus.','Your site is not configured to show a consent banner at the moment.'=>'Jūsų svetainė šiuo metu nesukonfigūruota rodyti sutikimo reklamjuostę.','Your site requires a consent banner, which has been enabled.'=>'Svetainėje reikalinga sutikimo reklamjuostė, kuri buvo įgalinta.','Your site uses Divi. If you use reCAPTCHA on your site, you may need to disable the reCAPTCHA integration in Complianz. '=>'Jūsų svetainė naudoja Divi. Jei savo svetainėje naudojate reCAPTCHA, gali reikėti išjungti reCAPTCHA integravimą „Complianz“.','Your site uses Google Fonts. For best privacy compliance, we recommend to self host Google Fonts. To self host, follow the instructions in the below link.'=>'Jūsų svetainė naudoja „Google“ šriftus. Kad būtų laikomasi geriausio privatumo, rekomenduojame sava