ser. For this reason we have set your privacy settings on this website to strictly necessary. If you want to have full functionality, please consider excluding %s from your privacy settings.'=>'Gavome privatumo signalą iš jūsų naršyklės. Dėl šios priežasties mes nustatėme jūsų privatumo nustatymus šioje svetainėje kaip griežtai būtinus. Jei norite turėti visas funkcijas, apsvarstykite galimybę neįtraukti %s iš savo privatumo nustatymų.','cookie policyYou have loaded the Cookie Policy without javascript support.'=>'Įkėlėte slapukų politiką be javascript palaikymo.','e.g. services like Google Fonts, Maps or reCAPTCHA usually place cookies.'=>'pvz. tokiose paslaugose kaip „Google Fonts“, „Maps“ ar „reCAPTCHA“ paprastai įdedami slapukai.','email signatureKind regards,'=>'Su pagarba,','https://www.complianz.io'=>'https://www.complianz.io','https://www.wordpress.org/plugins/complianz-gdpr'=>'https://www.wordpress.org/plugins/complianz-gdpr','if phonenumber is entered, this string is part of the sentence "you may contact %s, via %s or by telephone via %s"or by telephone on %s'=>'arba telefonu %s','notification emailYour legal documents on %s have not been updated in 12 months. Please log in and run the %swizard%s in the Complianz plugin to check if everything is up to date.'=>'Jūsų teisiniai dokumentai apie %s nebuvo atnaujinti per 12 mėnesių. Prisijunkite ir paleiskite %swizard%s Complianz papildinyje, kad patikrintumėte, ar viskas atnaujinta.','other information concerning the child or the parents, combined with an identifier as described above'=>'kita informacija apie vaiką ar tėvus kartu su identifikatoriumi, kaip aprašyta aukščiau','the page source'=>'puslapio šaltinis','waits for %s'=>'laukia %s']];
